import React from "react";
import ArrowBackIcon from "@mui/icons-material/ArrowBack";

export const CountryDetails = () => {
  return (
      <div className="country_details">
          <button className="back">
              <ArrowBackIcon/>
            <p>Go to Back</p>
          </button>

          <div className="country"></div>

      </div>
  )
};
